import React, { useState, useEffect } from 'react';
import { Modal, Button, Checkbox, Input, Slider, Select } from 'antd';
import axios from 'axios';

const { Option } = Select;

const FilterModal = () => {
  const [visible, setVisible] = useState(false);
  const [priceRange, setPriceRange] = useState([0, 500000]);
  const [cities, setCities] = useState([]);
  const [selectedCityId, setSelectedCityId] = useState(null);
  const [districts, setDistricts] = useState([]);
  const [loadingDistricts, setLoadingDistricts] = useState(false);
  const [selectedItems, setSelectedItems] = useState([]);

  const showModal = () => {
    setVisible(true);
  };

  const handleOk = () => {
    setVisible(false);
  };

  const handleCancel = () => {
    setVisible(false);
  };

  const handlePriceChange = (value) => {
    setPriceRange(value);
  };

  const handleCityChange = (value) => {
    setSelectedCityId(value);
  };

  useEffect(() => {
    const fetchCities = async () => {
      try {
        const response = await axios.get(
          'https://v1.nocodeapi.com/ebr123/google_sheets/MBXXeYjRrYchwfWk?tabId=ıller&filterValue=SEHİRLER'
        );
        setCities(response.data.data);
      } catch (error) {
        console.error('İller alınırken hata oluştu:', error);
      }
    };
    fetchCities();
  }, []);

  useEffect(() => {
    const fetchDistricts = async () => {
      if (!selectedCityId) return;
      setLoadingDistricts(true);
      try {
        const response = await axios.get(
          `https://v1.nocodeapi.com/ebr123/google_sheets/MBXXeYjRrYchwfWk?tabId=ılceler&filterValue=ılceler`
        );
        // Seçilen şehre bağlı olarak ilçeleri çek
        const filteredDistricts = response.data.data.filter(item => item.id === selectedCityId);
        setDistricts(filteredDistricts.map(item => item.ılceler));
      } catch (error) {
        console.error('İlçeler alınırken hata oluştu:', error);
      } finally {
        setLoadingDistricts(false);
      }
    };
    fetchDistricts();
  }, [selectedCityId]);

  const OPTIONS = ['1+1', '2+1', '3+1', 'çok odalı'];

  const filteredOptions = OPTIONS.filter((o) => !selectedItems.includes(o));

  return (
    <>
      <Button onClick={showModal}>Filtrele</Button>
      <Modal
        title="Filtreleme Seçenekleri"
        visible={visible}
        onOk={handleOk}
        onCancel={handleCancel}
      >
        <p>Oda Sayısı:</p>
        <Select
          mode="multiple"
          placeholder="Oda sayısı seçin"
          value={selectedItems}
          onChange={setSelectedItems}
          style={{ width: '100%' }}
          options={filteredOptions.map((item) => ({
            value: item,
            label: item,
          }))}
        />
        <p>Banyo Sayısı:</p>
        <Checkbox.Group options={['1 Banyo', '2 Banyo', '3 Banyo']} />
        <p>Fiyat Aralığı:</p>
        <Slider
          range
          min={0}
          max={500000}
          step={1000}
          defaultValue={[0, 500000]}
          onChange={handlePriceChange}
          value={priceRange}
        />
        <p>Konum:</p>
        <Input.Search placeholder="Semt veya mahalle girin..." />
        <p>İller:</p>
        <Select
          style={{ width: '100%' }}
          placeholder="İl seçin"
          onChange={handleCityChange}
        >
          {cities.map((city, index) => (
            <Option key={city.id} value={city.id}>
              {city.SEHİRLER}
            </Option>
          ))}
        </Select>
        <p>İlçeler:</p>
        <Select
          style={{ width: '100%' }}
          placeholder="İlçe seçin"
          loading={loadingDistricts}
          disabled={!selectedCityId}
        >
          {districts.map((district, index) => (
            <Option key={index} value={district}>
              {district}
            </Option>
          ))}
        </Select>
      </Modal>
    </>
  );
};

export default FilterModal;
